import React from 'react';
import { Button, Container } from 'semantic-ui-react';
import { Link } from 'react-router-dom';

const NavBar = ({ history, currentUser, logout, signUp }) => {
  const authButtons = (
    <Container>
      <Button color='red' onClick={() => history.push('/search')}>
        Search
      </Button>
      {currentUser && (
        <Button  color='red' onClick={() => history.push('/profile')}>
          Profile
        </Button>
      )}
      {currentUser && (
        <Button color='red' onClick={logout}>
          Logout
        </Button>
      )}
    </Container>
  );

  const guestButtons = (
    <Container>
      <Button as='link' color='red' to={'/login'}>
        Login
      </Button>

      <Button as='link' to={'/signup'} color='red'>
        SignUp
      </Button>
    </Container>
  );

  return <>{currentUser ? authButtons : guestButtons}</>;
};
export default NavBar;
